TITLE:
  - "Test for volfrac material with closing relation <blood lung>. Example tests only deformation dependence.
    - It uses node-to-point (NTP) coupling (flow and scalar transport)"
  - "between 1D arteries, 1D airways and corresponding phases in the"
  - "2D PoroMultiphaseScatra-Framework with moving structure."
PROBLEM SIZE:
  DIM: 2
PROBLEM TYPE:
  PROBLEMTYPE: "porofluid_pressure_based_elasticity_scatra"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 1
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  DISPLACEMENT: true
porofluid_elasticity_scatra_dynamic:
  output:
    result_data_every: 1
    restart_data_every: 1
  total_simulation_time: 0.3
  time_integration:
    number_of_time_steps: 3
    time_step_size: 0.1
    theta: 1
  coupling_scheme: twoway_monolithic
  artery_coupling_active: false
porofluid_elasticity_scatra_dynamic/monolithic:
  nonlinear_solver:
    linear_solver_id: 1
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "OneStepTheta"
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
porofluid_dynamic:
  initial_condition:
    type: by_condition
porofluid_elasticity_dynamic:
  solve_structure: true
  coupling_scheme: "twoway_monolithic"
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  MAXTIME: 0.3
  NUMSTEP: 3
  THETA: 1
  INITIALFIELD: "field_by_condition"
  SKIPINITDER: true
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  DEFINITION_TAU: "Zero"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  CONVTOL: 1e-07
  ABSTOLRES: -1
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "solver"
